I am trying to change the background color of an adaptive card in bot framework. I have tried the following code but it is not working.

```
{
  "type": "AdaptiveCard",
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello, world!"
    }
  ],
  "style": {
    "backgroundColor": "red"
  }
}
```

## Answer (1)

You can use the `backgroundColor` property of the `style` object to set the background color of the card. For example:

```
{
  "type": "AdaptiveCard",
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello, world!"
    }
  ],
  "style": {
    "backgroundColor": "#FF0000"
  }
}
```

Note that the value of the `backgroundColor` property must be a valid CSS color value. In this example, I've used the hexadecimal color code for red (`#FF0000`).

You can find more information about the `style` object and its properties in the Adaptive Cards documentation: https://adaptivecards.io/docs/design/

